import styled from 'styled-components';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

const Wrapper = styled.div`

  background-color: #1d2427;

`

class App extends Component {
  render() {
    return (
      <Wrapper>
        <MainContnet></MainContnet>
      </Wrapper>
    );
  }
}

export default App;
